import { Button } from '@mui/material';
import { useState } from 'react';
import QRCode from 'react-qr-code';
import Header from '../../header/header';

function Book() {
const [value, setValue] = useState();
const [time, setTime] = useState();


return (
	<div className="App" >
        <Header />
	<center  >
		<br />
		<br />
        <div style={{marginTop:'50px'}}>
        Name : 
		<input
		type="text"
		onChange={(e) => setValue(e.target.value)}
		placeholder="Enter The Name"
        style={
            { height:'30px' ,width:'300px', paddingLeft: '10px' , marginLeft:'50px',display:'flex', justifyContent:'center'}
        }
		/>
		
        <br />
        Date :
        <input
		type="date"
		onChange={(e) => setTime(e.target.time)}
		placeholder="Enter The Name"
        style={
            {marginTop:'80px', height:'30px' ,width:'300px', paddingLeft: '10px' , marginLeft:'50px',display:'flex', justifyContent:'center'}
        }
		/>
		<br />
		Time : 
        <input
		type="time"
		onChange={(e) => setTime(e.target.time)}
		placeholder="Enter The Name"
        style={
            {marginTop:'80px', height:'30px' ,width:'300px', paddingLeft: '10px' , marginLeft:'50px',display:'flex', justifyContent:'center'}
        }
		/>
		<br />
		<br />
	
       
		{value && (
                <QRCode
                title="Plant Wonders"
                value= {`${value} , 'booked successfully '`}
                
            />
        )}
		
        <br />
		<br />
		<br />
         <Button  onClick={()=>{ alert('Slot Booked Successfully Please Save the QR Code '); }}>Book Slot</Button>
		<br />
		<br />
		<br />
        </div>
	</center>
    
	</div>
);
}

export default Book;
